import * as React from "react";
import Row from "antd/lib/row";

import { Props as BaseProps } from 'one-ui';

interface Props extends BaseProps {
  type?: 'flex';
  gutter?: number;
}

export const Cards = (props: Props) => {
  const {
    style,
    className = 'ov-cards',
    children,
    type,
    gutter = 2,
  } = props;

  return (
    <Row
      type={type}
      style={style}
      className={className}
      gutter={gutter}
    >
      {children}
    </Row>
  );
};
